import React from "react";
import stylesheet from './Inbox.module.css'
import ChatItem from './components/Pages/Inbox/ChatItem/ChatItem'
import Message from "./components/Pages/Inbox/Message/Message";


const Inbox = (props) => {

    const i = props.InboxItems.map((object, i) => <ChatItem key={i} name={object.name} id={object.id} />)
    const m = InboxMessages.map((message, i) => <Message key={i} id={message.id} text={message.text} />)

    return (
        <div className={stylesheet.messages}>
            <div className={stylesheet.people}>
                {props.i}
            </div>
            <div className={stylesheet.dialogs}>
                {props.m}
            </div>
        </div>
    )
}

export default Inbox;
